; outline: 0px; text-align: center;&amp;quot;&amp;gt;&amp;lt;p&amp;gt;0&amp;lt;/p&amp;gt;&amp;lt;/td&amp;gt;&amp;lt;td class=&amp;quot;rule162&amp;quot; style=&amp;quot;box-sizing: border-box; margin: 0px; padding-top: 0px; padding-bottom: 0px; outline: 0px; text-align: center;&amp;quot;&amp;gt;&amp;lt;p&amp;gt;3&amp;lt;/p&amp;gt;&amp;lt;/td&amp;gt;&amp;lt;td class=&amp;quot;rule162&amp;quot; style=&amp;quot;box-sizing: border-box; margin: 0px; padding-top: 0px; padding-bottom: 0px; outline: 0px; text-align: center;&amp;quot;&amp;gt;&amp;lt;p&amp;gt;3&amp;lt;/p&amp;gt;&amp;lt;/td&amp;gt;&amp;lt;/tr&amp;gt;&amp;lt;tr style=&amp;quot;box-sizing: border-box;&amp;quot;&amp;gt;&amp;lt;td class=&amp;quot;rule16&amp;quot; style=&amp;quot;box-sizing: border-box; margin: 0px; padding-top: 0px; padding-bottom: 0px; outline: 0px; text-align: center;&amp;quot;&amp;gt;&amp;lt;strong style=&amp;quot;box-sizing: border-box;&amp;quot;&amp;gt;开奖&amp;lt;/strong&amp;gt;&amp;lt;/td&amp;gt;&amp;lt;td colspan=&amp;quot;3&amp;quot; style=&amp;quot;box-sizing: border-box; margin: 0px; padding-top: 0px; padding-bottom: 0px; outline: 0px; text-align: center;&amp;quot;&amp;gt;&amp;lt;p&amp;gt;0+ 3+ 3= 6&amp;lt;/p&amp;gt;&amp;lt;/td&amp;gt;&amp;lt;/tr&amp;gt;&amp;lt;/tbody&amp;gt;&amp;lt;/table&amp;gt;&amp;lt;p&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;/p&amp;gt;', null, '0', '100', '30000000', null, null, null, '0', null, '1', null, '1556616420');
INSERT INTO `hov_game` VALUES ('58', '3', 'PK赛车', 'pksc', 'sc', 'bjpk10', '120', '0', '&amp;lt;p&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;该游戏的投注时间、开奖时间和开奖号码与&amp;ldquo;北京PK拾&amp;rdquo;完全同步，北京时间（GMT+8）每天白天从上午09:02开到晚上23:57，每5分钟开一次奖,每天开奖179期。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;具体游戏规则如下:&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;1～10 两面：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;指 单、双；大、小。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;单、双：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;号码为双数叫双，如4、8；号码为单数叫单，如5、9。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;大、小：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;开出之号码大于或等于6为大，小于或等于5为小。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;第一名～第十名 车号指定：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;每一个车号为一投注组合，开奖结果&amp;ldquo;投注车号&amp;rdquo;对应所投名次视为中奖，其余情形视为不中奖。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;1～5龙虎&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;冠&amp;amp;nbsp;&amp;amp;nbsp;军 龙/虎：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;ldquo;第一名&amp;rdquo;车号大于&amp;ldquo;第十名&amp;rdquo;车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;亚&amp;amp;nbsp;&amp;amp;nbsp;军 龙/虎：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;ldquo;第二名&amp;rdquo;车号大于&amp;ldquo;第九名&amp;rdquo;车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;第三名 龙/虎：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;ldquo;第三名&amp;rdquo;车号大于&amp;ldquo;第八名&amp;rdquo;车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;第四名 龙/虎：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;ldquo;第四名&amp;rdquo;车号大于&amp;ldquo;第七名&amp;rdquo;车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;第五名 龙/虎：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;ldquo;第五名&amp;rdquo;车号大于&amp;ldquo;第六名&amp;rdquo;车号视为【龙】中奖、反之小于视为【虎】中奖，其余情形视为不中奖。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;冠军车号＋亚军车号＝冠亚和值（为3~19)&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;冠亚和单双：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;ldquo;冠亚和值&amp;rdquo;为单视为投注&amp;ldquo;单&amp;rdquo;的注单视为中奖，为双视为投注&amp;ldquo;双&amp;rdquo;的注单视为中奖，其余视为不中奖。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;冠亚和大小：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;ldquo;冠亚和值&amp;rdquo;大于11时投注&amp;ldquo;大&amp;rdquo;的注单视为中奖，小于或等于11时投注&amp;ldquo;小&amp;rdquo;的注单视为中奖，其余视为不中奖。&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;br/&amp;gt;&amp;lt;span style=&amp;quot;box-sizing: border-box; color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;冠亚和指定：&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(51, 51, 51); font-family: &amp;quot;&amp;gt;&amp;ldquo;冠亚和值&amp;rdquo;可能出现的结果为3～19， 投中对应&amp;ldquo;冠亚和值&amp;rdquo;数字的视为中奖，其余视为不中奖。&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;', null, '0', '100', '30000000', null, null, null, '0', null, '1', null, '1556625802');
